import React, { useEffect, useState } from 'react';
import axios, { AxiosResponse } from 'axios';
import { Button, Grid, Box } from '@material-ui/core';

const Users = () => {
    const [data, setData] = useState({} as AxiosResponse<any>);

    useEffect(() => {
        axios.get("http://127.0.0.1:5000/data").then((data) => {
            setData(data);
        });
    }, []);

    const renderData = () => {
        return (<Grid container spacing={1}>
            User list
            {(data && data.data ? data.data.map((each: any) =>
                (
                    <Grid item xs={3} md={12}>
                        <Box bgcolor={"#eee"} padding={1}>
                            <span>{each.name}</span> <span>{each.age}</span> <span>{each.id}</span>
                        </Box>
                    </Grid>
                )
            ) : '')}
        </Grid>)
    }


    return (
        <div>
            {renderData()}
        </div>
    );
}

export default Users;
